import React from 'react';
import { NavLink } from "react-router-dom";
import "../styles/settings.css";

function Navigation() {
    return (
      <div className="navigation">
          <link href="https://fonts.googleapis.com/css?family=Open+Sans:300,400,700&display=swap" rel="stylesheet"/>
          
        <NavLink exact to='/' class="link">
            Home
        </NavLink>
        <NavLink exact to='/galerie' class="link">  
            Galerie
        </NavLink>
        <NavLink exact to='/event' class="link">
            Events
        </NavLink>
        <NavLink exact to='/games' class="link">
            Games
        </NavLink>
        <NavLink exact to='/contact' class="link">
            Contacts
        </NavLink>
      </div>
    );
}
  
export default Navigation;
